    [],nt"revision_timestamp": "2015-06-17T01:57:00.409991",nt"name": "bald-eagle-management-guidelines-oregon-washington",nt"isopen":
    false,nt"url": null,nt"notes": "This report covers bald eagle management
    guidelines in Oregon and Washington. The purpose of these guidelines is to maintain
    the environmental conditions that are required for the survival of bald eagles in
    the Pacific Northwest. The emphasis will be on preventing human disturbance to eagles,
    particularly during the nesting season. The ultimate objective is to preserve at
    least present populations of eagles in Oregon and Washington. For management purposes,
    the following guidelines are divided into sections on Nesting, Feeding and Roosting.
    Except as otherwise noted, the guidelines apply to both public and private lands.",nt"license_title":
